function isValidEmail(email: string): boolean {
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  return emailRegex.test(email);
}
//手机注册
function isValidMobile(email: string): boolean {
  return phoneValid(email);
}
function isValidPassword(password: string): boolean {
  const lengthRegex = /.{8,}/;
  const uppercaseRegex = /[A-Z]/;
  const lowercaseRegex = /[a-z]/;
  const numberRegex = /\d/;

  return (
    lengthRegex.test(password) &&
    uppercaseRegex.test(password) &&
    lowercaseRegex.test(password) &&
    numberRegex.test(password)
    // password.trim() !== ''
  );
}

function registerAccount() {
  if (!isAgreeService.value) {
    return;
  }
  loginBtn.value.type = '1';
  let code = shareUserId(false, codeText.value);
  //生成随机头像
  const randomInteger = Math.floor(Math.random() * 9) + 1;
  const randomString = randomInteger.toString();
  let pixel = localStorage.getItem('pixel');
  let channelId = localStorage.getItem('channelId');
  if (selectLoginMode.value == 0) {
    registerByPhone(
      selectLoginMode.value,
      emailText.value,
      passwordText.value,
      randomString,
      countryName.value.toString(),
      code ? code : undefined,
      pixel ? pixel : undefined,
      channelId ? channelId : undefined,
    ).then((response) => {
      loginBtn.value.type = '0';
      if (response === 'success') {
        reportingEvents('CompleteRegistration', pixel);
        loginFuc(true);
      }
    });
  } else {
    regiter(
      selectLoginMode.value,
      emailText.value,
      passwordText.value,
      randomString,
      countryName.value.toString(),
      emailCodeText.value,
      code,
      pixel ? pixel : undefined,
      channelId ? channelId : undefined,
    ).then((response) => {
      loginBtn.value.type = '0';
      if (response === 'success') {
        reportingEvents('CompleteRegistration', pixel);
        loginFuc(true);
      }
    });
  }
}

//验证码返回上一级
function goBack() {
  isInputCode.value = false;
}
//重发验证吗
function sendAgain() {
  codeSend();
}
//验证码
function codeSend() {
  getCode(emailText.value, 1).then((response) => {
    if (response) {
      isInputCode.value = true;
    }
  });
}

function submitForm() {
  if (isValidPassword(passwordText.value)) {
    if (selectLoginMode.value == 0 && isValidMobile(emailText.value)) {
      if (isLogin.value) {
        loginBtn.value.type = '1';
        loginFuc(false);
      } else {
        //手机注册跳过收验证码环节
        registerAccount();
      }
    } else if (selectLoginMode.value == 1 && isValidEmail(emailText.value)) {
      if (isLogin.value) {
        loginBtn.value.type = '1';
        loginFuc(false);
      } else {
        codeSend();
      }
    } else {
      loginBtn.value.type = '2';
    }
  } else {
    loginBtn.value.type = '2';
  }
}
function loginFuc(isRegister: boolean) {
  let client = localStorage.getItem('client');
  if (selectLoginMode.value == 0) {
    loginByPhone(
      emailText.value,
      passwordText.value,
      client ? client : undefined,
    ).then((response) => {
      if (!isRegister) {
        loginBtn.value.type = '0';
      }
      if (!response) return;
      // 登陆事件
      reportingEvents('login', response.pixelId);
      tokenController.update(response.token, response.freshToken);
      dataCenter.user.update(response);
      getUserBalance().then((wallet) => {
        dataCenter.wallet.update(wallet);
      });
      closeFunction?.();
      if (isRegister) {
        openModal(preferentialVue);
      } else {
        //九宫格广告
        gridNineAdvertisingIsShow();
      }
      //初始化活动
      gameActive.init();
    });
  } else {
    login(
      emailText.value,
      passwordText.value,
      client ? client : undefined,
    ).then((response) => {
      if (!isRegister) {
        loginBtn.value.type = '0';
      }
      if (!response) return;
      // 登陆事件
      reportingEvents('login', response.pixelId);
      tokenController.update(response.token, response.freshToken);
      dataCenter.user.update(response);
      getUserBalance().then((wallet) => {
        dataCenter.wallet.update(wallet);
      });
      closeFunction?.();
      if (isRegister) {
        openModal(preferentialVue);
      } else {
        //九宫格广告
        gridNineAdvertisingIsShow();
      }
      //初始化活动
      gameActive.init();
    });
  }
}
