  if (key == 'email' || key == 'mobile') {
    emailText.value = text;
  }
  if (key == 'password') {
    passwordText.value = text;
  }

  if (key == 'code') {
    codeText.value = text;
  }
}
/**登陆方式 */
function selectModeItem(key: number) {
  if (selectLoginMode.value == key) {
    return;
  }
  emailText.value = '';
  selectLoginMode.value = key;
  if (key == 0) {
    list[0] = mobileItem;
  } else if (key == 1) {
    list[0] = emailItem;
  }
}
//获取邮件验证码
function onChange(codeArr: string[]) {
  emailCodeText.value = codeArr.join('');
}
