  () => {
    return emailText.value;
  },
  () => {
    loginBtn.value.type = '0';
  },
);
watch(
  () => {
    return passwordText.value;
  },
  () => {
    loginBtn.value.type = '0';
  },
);

function btnClick(isClickLogin: boolean) {
  isLogin.value = isClickLogin;
  if (isClickLogin) {
    loginBtn.value.text = 'Login';
  } else {
    loginBtn.value.text = 'Create account';
  }
}
